import React from 'react';
import jsPDF from 'jspdf'
class PdfGenerator extends React.Component {

  constructor(props) {
    super(props)
    this.state = {
      t: "hello"
    }

  };
  generatePDF = () => {
    var doc = new jsPDF('landscape');
    var linechart = 'data:image/png;base64,'
    var bubblechart = 'data:image/png;base64,'

    var barchart = 'data:image/png;base64,'

    doc.addFont('helvetica', 'normal')

    // long one
    // inside the long one
    doc.rect(5, 7, 70, 19);

    doc.rect(5, 27, 70, 37);
    doc.setFontSize(26);
    doc.text(11, 44, `${this.props.criminals}`)
    doc.setFontSize(12);
    doc.text(12, 51, 'CRIMINALS')

    doc.rect(5, 65, 70, 35);
    doc.setFontSize(26);
    doc.text(11, 82, `${this.props.commonCrime}`)
    doc.setFontSize(12);
    doc.text(12, 89, 'MOST COMMON CRIME')

    doc.rect(5, 99, 70, 35);
    doc.setFontSize(26);
    doc.text(11, 116, `${this.props.prosecutionRate}`)
    doc.setFontSize(12);
    doc.text(12, 123, 'PROSECUTION RATE')

    doc.rect(5, 133, 70, 35);
    doc.setFontSize(26);
    doc.text(11, 150, `${this.props.ssCount}`)
    doc.setFontSize(12);
    doc.text(12, 157, 'STOP AND SEARCHES')

    doc.rect(5, 167, 70, 35);
    doc.setFontSize(26);
    doc.text(11, 184, 'APRIL')
    doc.setFontSize(12);
    doc.text(12, 191, 'HIGHEST MONTH FOR CRIME')
    //top line
    doc.rect(76, 7, 123, 54);
    doc.rect(200, 7, 90, 54);
    //middle one
    doc.rect(76, 62, 150, 72);
    doc.addImage(bubblechart, 'JPEG', 80, 67)
    doc.rect(227, 62, 63, 72);

    doc.rect(76, 135, 214, 67);
    doc.addImage(linechart, 'JPEG', 82, 142)

    // doc.rect(205, 162, 85, 40);
    // doc.addImage(barchart, 'JPEG', 89, 7)

    doc.save('crime-report.pdf')
  }

  render() {
    return (
      <div>
        <button className="button-logout" onClick={this.generatePDF} type="primary">Download PDF</button>
      </div>
    );
  }
}
export default PdfGenerator;